<script>
  // Panel toggle
  const panel = document.getElementById('rightpanel');
  const btnClose = document.getElementById('panelClose');
  const btnOpen = document.getElementById('panelOpen');
  function hidePanel() { panel.style.transform = 'translateX(110%)'; btnOpen.style.display = 'block'; }
  function showPanel() { panel.style.transform = 'translateX(0)'; btnOpen.style.display = 'none'; }
  btnClose.addEventListener('click', hidePanel);
  btnOpen.addEventListener('click', showPanel);

  // Generic overlay toggling by matching Leaflet layer labels
  function setOverlayChecked(labelText, shouldBeChecked) {
    const labels = document.querySelectorAll('.leaflet-control-layers-overlays label');
    for (const lab of labels) {
      if (lab.textContent.trim() === labelText.trim()) {
        const cb = lab.querySelector('input[type="checkbox"]');
        if (!!cb.checked !== !!shouldBeChecked) cb.click();
        return true;
      }
    }
    return false;
  }
  window.toggleOverlay = function(labelText, el) {
    const labels = document.querySelectorAll('.leaflet-control-layers-overlays label');
    for (const lab of labels) {
      if (lab.textContent.trim() === labelText.trim()) {
        const cb = lab.querySelector('input[type="checkbox"]');
        cb.click();
        if (el) el.checked = cb.checked;
        break;
      }
    }
  }
  window.selectAll = function(prefix) {
    const labels = document.querySelectorAll('.leaflet-control-layers-overlays label');
    const rightBoxes = document.querySelectorAll('#rightpanel input[type="checkbox"][id^="' + prefix + '_"]');
    for (const lab of labels) {
      if (lab.textContent.trim().startsWith(prefix + ':')) {
        const cb = lab.querySelector('input[type="checkbox"]');
        if (!cb.checked) cb.click();
      }
    }
    for (const r of rightBoxes) r.checked = true;
  }
  window.deselectAll = function(prefix) {
    const labels = document.querySelectorAll('.leaflet-control-layers-overlays label');
    const rightBoxes = document.querySelectorAll('#rightpanel input[type="checkbox"][id^="' + prefix + '_"]');
    for (const lab of labels) {
      if (lab.textContent.trim().startsWith(prefix + ':')) {
        const cb = lab.querySelector('input[type="checkbox"]');
        if (cb.checked) cb.click();
      }
    }
    for (const r of rightBoxes) r.checked = false;
  }
</script>

</body>
